import React, { useMemo } from "react";

const Student = (props) => {
  const {
    city,
    company,
    email,
    firstName,
    grades,
    id,
    lastName,
    pic,
    skill,
  } = props.info;

  const average = useMemo(() => {
    let average = 0;
    for (const grade of grades) {
      average += parseInt(grade, 10);
    }
    return average / grades.length;
  }, [grades]);

  console.log(props.info);
  return (
    <div style={{ width: "100%", display: "flex" }}>
      <div
        style={{
          width: "20%",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <img
          src={pic}
          style={{
            borderRadius: "50%",
            border: "1px solid rgb(220, 220, 220)",
            height: "80%",
            marginTop: "10%",
          }}
        />
      </div>
      <div
        style={{
          width: "80%",
          justifyContent: "flex-start",
          alignItems: "center",
        }}
      >
        <p>
          {firstName} {lastName}
        </p>
        <p>Email: {email}</p>
        <p>Company: {company}</p>
        <p>Skill: {skill}</p>
        <p>Average: {average}%</p>
      </div>
    </div>
  );
};

export default Student;
